import React from "react";
import Card from "./Card.jsx";
import contacts from "../contacts.js";

function ShowCards(){
    var output = contacts.forEach(function(contact){
    <Card
        name={contact.name}
        img={contact.imgURL}
        tel={contact.phone}
        email={contact.email}
      />    
    })
    return output;
}


export default ShowCards;
